import React from "react";
import MenuItem from "./MenuItem";

const PostMenu = () => {
  return (
    <ul className="post_menu">
      <li className="post_menu_item">
        <MenuItem icon={icon} title={title} subtitle={subtitle} />
      </li>
    </ul>
  );
};

export default PostMenu;
